import React, { Component } from 'react'

export class Navbar extends Component {

 static defaultProps = {
   title: 'You forget Add Props..'
 }

  render() {
    return (
      <nav className="navbar bg-primary">
        <h2>{this.props.title}</h2>
      </nav>
    )
  }
}

export default Navbar
